import React from "react";

const Header = () => {
  return (
    <div className="header">
      <a href="#">HOME</a>
      <a href="#">GALLERY</a>
      <a href="#">MAP</a>
      <a href="#">ABOUT</a>
    </div>
  );
};

export default Header;
